(2, 2, 'DURAPRO', 'DURAPRO', '', '<p><a title=\"Personaliza tu funda\" href=\"https://www.ion-3d.com/designer3d\" target=\"_blank\" rel=\"noopener\"><img style=\"border-radius: 5px; display: block; margin-left: auto; margin-right: auto;\" src=\"https://ion-3d.com/storage/tinymce/sK7oAJvwY0KjF7BQtHo7dvApKVgjzlyaKnjgGgtS.png\" alt=\"Familia de fundas Durapro\" width=\"100%\" height=\"700\"></a> &nbsp;</p>', 'DURAPRO', 'Protege tu iPhone con las fundas DuraPro. Diseñadas para resistir el uso diario. ¡Elegancia, durabilidad y estilo en un solo producto!', 'FUNDA DURAPRO 3D iPHONE', 1, 'es'),
(15, 2, 'Phone covers', 'phone-covers', '', '<p>Phone covers</p>', 'Phone covers', 'Phone covers', 'Phone covers', 2, 'en'),
(110, 53, 'ECO', 'eco', '', '<p>&nbsp; &nbsp;</p>', 'ECO', 'Explora las fundas Eco para iPhone, tu opción respetuosa con el medio ambiente. Hechas con materiales sostenibles y reciclables, nuestras fundas protegen tu iPhone y el planeta. ¡Familia Eco, donde la tecnología se une con la ecología!', 'FUNDAS 3D ECO IPHONE', 1, 'es'),
(111, 53, 'ECO', 'fundas-eco', '', '<p>&nbsp; &nbsp;</p>', 'FUNDAS ECO', 'FUNDAS 3D ECO IHPONE', 'FUNDAS 3D ECO IHPONE', 2, 'en'),
(112, 54, 'NATURA', 'natura', '', '<p>&nbsp; &nbsp; &nbsp;</p>', 'NATURA', 'Natura para iPhone, un producto verdaderamente sostenible. Reciclamos redes de pesca del mar para crear fundas que protegen tu dispositivo y ayudan a limpiar nuestros océanos. ¡Familia Natura, donde la tecnología se encuentra con la sostenibilidad marina!', 'FUNDA 3D NATURA IHPONE', 1, 'es'),
(113, 54, 'NATURA', 'funda-natura', '', '<p>&nbsp; &nbsp; &nbsp;</p>', 'FUNDA NATURA', 'FUNDA 3D NATURA IHPONE', 'FUNDA 3D NATURA IHPONE', 2, 'en'),
