INSERT INTO `cms_page_translations` (`id`, `page_title`, `url_key`, `html_content`, `meta_title`, `meta_description`, `meta_keywords`, `locale`, `cms_page_id`) VALUES
(1, 'Acerca de Nosotros', 'about-us', '<div id=\"about-us\">\r\n<h1 style=\"font-size: 2.5em; text-align: center;\"><strong>ACERCA DE NOSOTROS</strong></h1>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center; padding-left: 120px;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">ION3D es una empresa l&iacute;der en la vanguardia de la impresi&oacute;n 3D, dedicada a la fabricaci&oacute;n de fundas para dispositivos m&oacute;viles en Espa&ntilde;a. Cada producto que sale de nuestra f&aacute;brica es una muestra de la innovaci&oacute;n y la calidad que define a nuestra marca. Con un enfoque en la personalizaci&oacute;n, garantizamos que cada funda es tan &uacute;nica como nuestros clientes.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n</div>\r\n<div id=\"our-commitment\" style=\"text-align: center;\">\r\n<h1 style=\"font-size: 2.5em; text-align: center;\"><span style=\"color: rgb(53, 152, 219);\"><strong>NUESTRO COMPROMISO</strong></span></h1>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">En ION3D, nuestro compromiso es doble: con nuestros clientes y con el planeta. Nos esforzamos por ofrecer una experiencia de usuario excepcional, proporcionando productos que no solo son personalizados y de alta calidad, sino tambi&eacute;n producidos de manera &eacute;tica y sostenible. Apoyamos el talento local y la industria espa&ntilde;ola, asegurando que cada funda refleje el esp&iacute;ritu de innovaci&oacute;n de nuestra naci&oacute;n.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n</div>\r\n<div id=\"sustainability\" style=\"text-align: center;\">\r\n<h1 style=\"font-size: 2.5em;\"><span style=\"color: rgb(45, 194, 107);\"><strong>SOSTENIBILIDAD</strong></span></h1>\r\n<p>&nbsp;</p>\r\n<p>La sostenibilidad es el n&uacute;cleo de nuestra filosof&iacute;a empresarial. Nos dedicamos a reducir la huella de carbono y a promover pr&aacute;cticas que protejan nuestro medio ambiente. Al elegir la impresi&oacute;n 3D por demanda, minimizamos el desperdicio y maximizamos la eficiencia, demostrando que es posible ser ecol&oacute;gicos sin sacrificar la calidad.</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div id=\"challenges\" style=\"text-align: center;\">\r\n<h1 style=\"font-size: 2.5em;\"><span style=\"color: rgb(132, 63, 161);\"><strong>RETOS</strong></span></h1>\r\n<p>&nbsp;</p>\r\n<p>Los retos son oportunidades para ION3D. Nos enfrentamos a la sobreproducci&oacute;n y al exceso de inventario con soluciones innovadoras que no solo benefician a nuestros clientes, sino que tambi&eacute;n establecen nuevos est&aacute;ndares para la industria. Aceptamos el desaf&iacute;o de liderar el cambio hacia un futuro m&aacute;s sostenible y responsable.</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div id=\"environment\" style=\"text-align: center;\">\r\n<h1 style=\"font-size: 2.5em;\"><strong><span style=\"color: rgb(22, 145, 121);\">MEDIO AMBIENTE</span></strong></h1>\r\n<p>&nbsp;</p>\r\n<p>Nuestro amor por el medio ambiente impulsa cada decisi&oacute;n que tomamos. Desde la selecci&oacute;n de materiales hasta nuestros procesos de producci&oacute;n, todo est&aacute; dise&ntilde;ado para reducir el impacto ambiental. Creemos firmemente que las empresas tienen la responsabilidad de cuidar el planeta que todos compartimos.</p>\r\n</div>\r\n<div id=\"materials\">\r\n<h1 style=\"font-size: 2.5em; text-align: center;\"><span style=\"color: rgb(230, 126, 35);\"><strong>MATERIALES</strong></span></h1>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">Los materiales que utilizamos en ION3D son cuidadosamente seleccionados por su calidad y su impacto ambiental. Optamos por materiales reciclables y sostenibles, asegurando que cada funda no solo sea duradera y funcional, sino tambi&eacute;n amigable con el medio ambiente.</p>\r\n</div>', 'Somos iON3D', 'Historia de iON3D', 'Quienes somos', 'es', 1),
(5, 'Términos de Uso', 'legal-disclaimer', '<div id=\"legal-notice\">\r\n<h1 style=\"font-size: 2.5em; text-align: center;\">Aviso legal</h1>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<div id=\"lssi\">\r\n<h2 style=\"font-size: 2em;\">LEY DE LOS SERVICIOS DE LA SOCIEDAD DE LA INFORMACI&Oacute;N (LSSI)</h2>\r\n<p>iON3D Iberia S.L , responsable del sitio web, en adelante RESPONSABLE, pone a disposici&oacute;n de los usuarios el presente documento, con el que pretende dar cumplimiento a las obligaciones dispuestas en la Ley 34/2002, de 11 de julio, de Servicios de la Sociedad de la Informaci&oacute;n y de Comercio Electr&oacute;nico (LSSICE), BOE N.o 166, as&iacute; como informar a todos los usuarios del sitio web respecto a cu&aacute;les son las condiciones de uso.</p>\r\n<p>Toda persona que acceda a este sitio web asume el papel de usuario, comprometi&eacute;ndose a la observancia y cumplimiento riguroso de las disposiciones aqu&iacute; dispuestas, as&iacute; como a cualquier otra disposici&oacute;n legal que fuera de aplicaci&oacute;n.</p>\r\n<p>iON3D Iberia S.L se reserva el derecho de modificar cualquier tipo de informaci&oacute;n que pudiera aparecer en el sitio web, sin que exista obligaci&oacute;n de preavisar o poner en conocimiento de los usuarios dichas obligaciones, entendi&eacute;ndose como suficiente la publicaci&oacute;n en el sitio web de ION-ED.</p>\r\n</div>\r\n<div id=\"identifying-data\">\r\n<h2 style=\"font-size: 2em;\">1. DATOS IDENTIFICATIVOS</h2>\r\n<ul>\r\n<li>Nombre de dominio: www.ion-3d.com</li>\r\n<li>Nombre comercial: ION3D</li>\r\n<li>Denominaci&oacute;n social: iON3D Iberia S.L</li>\r\n<li>NIF: B70960950</li>\r\n<li>Domicilio social: CAMINO DE MURCIA,69</li>\r\n<li>Tel&eacute;fono: 675968281</li>\r\n<li>E-mail: info@ion-3d.com</li>\r\n</ul>\r\n</div>\r\n<div id=\"intellectual-property-rights\">\r\n<h2 style=\"font-size: 2em;\">2. DERECHOS DE PROPIEDAD INTELECTUAL E INDUSTRIAL</h2>\r\n<p>El sitio web, incluyendo a t&iacute;tulo enunciativo pero no limitativo su programaci&oacute;n, edici&oacute;n, compilaci&oacute;n y dem&aacute;s elementos necesarios para su funcionamiento, los dise&ntilde;os, logotipos, texto y/o gr&aacute;ficos, son propiedad del RESPONSABLE o, si es el caso, dispone de licencia o autorizaci&oacute;n expresa por parte de los autores. Todos los contenidos del sitio web se encuentran debidamente protegidos por la normativa de propiedad intelectual e industrial, as&iacute; como inscritos en los registros p&uacute;blicos correspondientes.</p>\r\n<p>Independientemente de la finalidad para la que fueran destinados, la reproducci&oacute;n total o parcial, uso, explotaci&oacute;n, distribuci&oacute;n y comercializaci&oacute;n, requiere en todo caso la autorizaci&oacute;n escrita previa por parte del RESPONSABLE. Cualquier uso no autorizado previamente se considera un incumplimiento grave de los derechos de propiedad intelectual o industrial del autor.</p>\r\n<p>Los dise&ntilde;os, logotipos, texto y/o gr&aacute;ficos ajenos al RESPONSABLE y que pudieran aparecer en el sitio web, pertenecen a sus respectivos propietarios, siendo ellos mismos responsables de cualquier posible controversia que pudiera suscitarse respecto a los mismos. El RESPONSABLE autoriza expresamente a que terceros puedan redirigir directamente a los contenidos concretos del sitio web, y en todo caso redirigir al sitio web principal de www.ion-3d.com.</p>\r\n<p>El RESPONSABLE reconoce a favor de sus titulares los correspondientes derechos de propiedad intelectual e industrial, no implicando su sola menci&oacute;n o aparici&oacute;n en el sitio web la existencia de derechos o responsabilidad alguna sobre los mismos, como tampoco respaldo, patrocinio o recomendaci&oacute;n por parte del mismo.</p>\r\n<p>Para realizar cualquier tipo de observaci&oacute;n respecto a posibles incumplimientos de los derechos de propiedad intelectual o industrial, as&iacute; como sobre cualquiera de los contenidos del sitio web, puede hacerlo a trav&eacute;s del correo electr&oacute;nico info@ion-3d.com</p>\r\n</div>\r\n<div id=\"disclaimer\">\r\n<h2 style=\"font-size: 2em;\">3. EXENCI&Oacute;N DE RESPONSABILIDADES</h2>\r\n<p>El RESPONSABLE se exime de cualquier tipo de responsabilidad derivada de la informaci&oacute;n publicada en su sitio web siempre que no tenga conocimiento efectivo de que esta informaci&oacute;n haya sido manipulada o introducida por un tercero ajeno al mismo o, si lo tiene, haya actuado con diligencia para retirar los datos o hacer imposible el acceso a ellos.</p>\r\n<div id=\"cookies-policy\">\r\n<h1 style=\"font-size: 2.5em;\">Uso de Cookies</h1>\r\n<p>Este sitio web puede utilizar cookies t&eacute;cnicas (peque&ntilde;os archivos de informaci&oacute;n que el servidor env&iacute;a al ordenador de quien accede a la p&aacute;gina) para llevar a cabo determinadas funciones que son consideradas imprescindibles para el correcto funcionamiento y visualizaci&oacute;n del sitio. Las cookies utilizadas tienen, en todo caso, car&aacute;cter temporal, con la &uacute;nica finalidad de hacer m&aacute;s eficaz la navegaci&oacute;n, y desaparecen al terminar la sesi&oacute;n del usuario. En ning&uacute;n caso, estas cookies proporcionan por s&iacute; mismas datos de car&aacute;cter personal y no se utilizar&aacute;n para la recogida de los mismos.</p>\r\n<p>Mediante el uso de cookies tambi&eacute;n es posible que el servidor donde se encuentra la web reconozca el navegador utilizado por el usuario con la finalidad de que la navegaci&oacute;n sea m&aacute;s sencilla, permitiendo, por ejemplo, el acceso de los usuarios que se hayan registrado previamente a las &aacute;reas, servicios, promociones o concursos reservados exclusivamente a ellos sin tener que registrarse en cada visita. Tambi&eacute;n se pueden utilizar para medir la audiencia, par&aacute;metros de tr&aacute;fico, controlar el progreso y n&uacute;mero de entradas, etc., siendo en estos casos cookies prescindibles t&eacute;cnicamente, pero beneficiosas para el usuario. Este sitio web no instalar&aacute; cookies prescindibles sin el consentimiento previo del usuario.</p>\r\n<p>Este sitio web utiliza cookies anal&iacute;ticas para habilitar la funci&oacute;n de control de visitas &uacute;nicas con el fin de facilitarle su navegaci&oacute;n. A todo usuario que visita la web se le informa del uso de estas cookies mediante un banner flotante, considerando que si acepta el tratamiento est&aacute; de acuerdo con su uso. En el caso de aceptar su uso, el banner desaparecer&aacute;, aunque en todo momento podr&aacute; revocar el consentimiento y obtener m&aacute;s informaci&oacute;n consultando nuestra Pol&iacute;tica de cookies.</p>\r\n<p>El usuario tiene la posibilidad de configurar su navegador para ser alertado de la recepci&oacute;n de cookies y para impedir su instalaci&oacute;n en su equipo. Por favor, consulte las instrucciones de su navegador para ampliar esta informaci&oacute;n.</p>\r\n</div>\r\n<div id=\"links-policy\">\r\n<h1 style=\"font-size: 2.5em;\">Pol&iacute;tica de enlaces</h1>\r\n<p>Desde el sitio web, es posible que se redirija a contenidos de terceros sitios web. Dado que el RESPONSABLE no puede controlar siempre los contenidos introducidos por terceros en sus respectivos sitios web, no asume ning&uacute;n tipo de responsabilidad respecto a dichos contenidos. En todo caso, proceder&aacute; a la retirada inmediata de cualquier contenido que pudiera contravenir la legislaci&oacute;n nacional o internacional, la moral o el orden p&uacute;blico, procediendo a la retirada inmediata de la redirecci&oacute;n a dicho sitio web, poniendo en conocimiento de las autoridades competentes el contenido en cuesti&oacute;n.</p>\r\n<p>El RESPONSABLE no se hace responsable de la informaci&oacute;n y contenidos almacenados, a t&iacute;tulo enunciativo pero no limitativo, en foros, chats, generadores de blogs, comentarios, redes sociales o cualquier otro medio que permita a terceros publicar contenidos de forma independiente en la p&aacute;gina web del RESPONSABLE. Sin embargo, y en cumplimiento de lo dispuesto en los art&iacute;culos 11 y 16 de la LSSICE, se pone a disposici&oacute;n de todos los usuarios, autoridades y fuerzas de seguridad, colaborando de forma activa en la retirada o, en su caso, bloqueo de todos aquellos contenidos que puedan afectar o contravenir la legislaci&oacute;n nacional o internacional, los derechos de terceros o la moral y el orden p&uacute;blico. En caso de que el usuario considere que existe en el sitio web alg&uacute;n contenido que pudiera ser susceptible de esta clasificaci&oacute;n, se ruega lo notifique de forma inmediata al administrador del sitio web.</p>\r\n<p>Este sitio web se ha revisado y probado para que funcione correctamente. En principio, puede garantizarse el correcto funcionamiento los 365 d&iacute;as del a&ntilde;o, 24 horas al d&iacute;a. Sin embargo, el RESPONSABLE no descarta la posibilidad de que existan ciertos errores de programaci&oacute;n, o que acontezcan causas de fuerza mayor, cat&aacute;strofes naturales, huelgas o circunstancias.</p>\r\n</div>\r\n</div>\r\n</div>', 'Aviso Legal', 'Aviso Legal', 'legal disclaimer', 'es', 5),
(11, 'Política de Privacidad', 'privacy-policy', '<div id=\"privacy-policy\">\r\n<h1 style=\"font-size: 3em; text-align: center;\"><strong>POL&Iacute;TICA DE PRIVACIDAD</strong></h1>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<div id=\"user-info\">\r\n<h2 style=\"font-size: 2em;\"><strong>1. INFORMACI&Oacute;N AL USUARIO</strong></h2>\r\n<p>&nbsp;</p>\r\n<p>&iquest;Qui&eacute;n es el responsable del tratamiento de tus datos personales?</p>\r\n<p>iON3D Iberia S.L es el RESPONSABLE del tratamiento de los datos personales del USUARIO y le informa de que estos datos ser&aacute;n tratados de conformidad con lo dispuesto en el Reglamento (UE) 2016/679, de 27 de abril (GDPR), y la Ley Org&aacute;nica 3/2018, de 5 de diciembre (LOPD GDD).</p>\r\n<p>&iquest;Para qu&eacute; tratamos tus datos personales? Para mantener una relaci&oacute;n comercial con el usuario. Las operaciones previstas para realizar el tratamiento son:</p>\r\n<ul>\r\n<li>Remisi&oacute;n de comunicaciones comerciales publicitarias por e-mail, fax, SMS, MMS, redes sociales o cualquier otro medio electr&oacute;nico o f&iacute;sico, presente o futuro, que posibilite realizar comunicaciones comerciales. Estas comunicaciones ser&aacute;n realizadas por el RESPONSABLE y estar&aacute;n relacionadas con sus productos y servicios, o de sus colaboradores o proveedores, con los que este haya alcanzado alg&uacute;n acuerdo de promoci&oacute;n. En este caso, los terceros nunca tendr&aacute;n acceso a los datos personales.</li>\r\n<li>Realizar estudios de mercado y an&aacute;lisis estad&iacute;sticos.</li>\r\n<li>Tramitar encargos, solicitudes, dar respuesta a las consultas o cualquier tipo de petici&oacute;n que sea realizada por el USUARIO a trav&eacute;s de cualquiera de las formas de contacto que se ponen a su disposici&oacute;n en la p&aacute;gina web del RESPONSABLE.</li>\r\n<li>Remitir el bolet&iacute;n informativo online, sobre novedades, ofertas y promociones en nuestra actividad.</li>\r\n</ul>\r\n<p>&iquest;Por qu&eacute; motivo podemos tratar tus datos personales? Porque el tratamiento est&aacute; legitimado por el art&iacute;culo 6 del GDPR de la siguiente forma:</p>\r\n<ul>\r\n<li>Con el consentimiento del USUARIO: remisi&oacute;n de comunicaciones comerciales y del bolet&iacute;n informativo.</li>\r\n<li>Por inter&eacute;s leg&iacute;timo del RESPONSABLE: realizar estudios de mercado, an&aacute;lisis estad&iacute;sticos, etc. y tramitar encargos, solicitudes, etc. a petici&oacute;n del USUARIO.</li>\r\n</ul>\r\n<p>&iquest;Durante cu&aacute;nto tiempo guardaremos tus datos personales? Se conservar&aacute;n durante no m&aacute;s tiempo del necesario para mantener el fin del tratamiento o existan prescripciones legales que dictaminen su custodia y cuando ya no sea necesario para ello, se suprimen con medidas de seguridad adecuadas para garantizar la anonimizaci&oacute;n de los datos o la destrucci&oacute;n total de los mismos.</p>\r\n<p>&iquest;A qui&eacute;n facilitamos tus datos personales? No est&aacute; prevista ninguna comunicaci&oacute;n de datos personales a terceros salvo, si fuese necesario para el desarrollo y ejecuci&oacute;n de las finalidades del tratamiento, a nuestros proveedores de servicios relacionados con comunicaciones, con los cuales el RESPONSABLE tiene suscritos los contratos de confidencialidad y de encargado de tratamiento exigidos por la normativa vigente de privacidad.</p>\r\n<p>&iquest;Cu&aacute;les son tus derechos? Los derechos que asisten al USUARIO son:</p>\r\n<ul>\r\n<li>Derecho a retirar el consentimiento en cualquier momento.</li>\r\n<li>Derecho de acceso, rectificaci&oacute;n, portabilidad y supresi&oacute;n de sus datos, y de limitaci&oacute;n u oposici&oacute;n a su tratamiento.</li>\r\n<li>Derecho a presentar una reclamaci&oacute;n ante la autoridad de control (www.aepd.es) si considera que el tratamiento no se ajusta a la normativa vigente.</li>\r\n</ul>\r\n<p>Datos de contacto para ejercer sus derechos: iON3D Iberia S.L.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div id=\"mandatory-info\">\r\n<h2 style=\"font-size: 2em;\"><strong>2. CAR&Aacute;CTER OBLIGATORIO O FACULTATIVO DE LA INFORMACI&Oacute;N FACILITADA POR EL USUARIO</strong></h2>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Los USUARIOS, mediante la marcaci&oacute;n de las casillas correspondientes y la entrada de datos en los campos, marcados con un asterisco (*) en el formulario de contacto o presentados en formularios de descarga, aceptan expresamente y de forma libre e inequ&iacute;voca, que sus datos son necesarios para atender su petici&oacute;n, por parte del prestador, siendo voluntaria la inclusi&oacute;n de datos en los campos restantes. El USUARIO garantiza que los datos personales facilitados al RESPONSABLE son veraces y se hace responsable de comunicar cualquier modificaci&oacute;n de los mismos.&nbsp;</p>\r\n<p dir=\"ltr\">El RESPONSABLE informa de que todos los datos solicitados a trav&eacute;s del sitio web son obligatorios, ya que son necesarios para la prestaci&oacute;n de un servicio &oacute;ptimo al USUARIO. En caso de que no se faciliten todos los datos, no se garantiza que la informaci&oacute;n y servicios facilitados sean completamente ajustados a sus necesidades.&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<h2 style=\"font-size: 2em;\"><strong>2. MEDIDAS DE SEGURIDAD</strong>&nbsp;</h2>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\">Que de conformidad con lo dispuesto en las normativas vigentes en protecci&oacute;n de datos personales, el RESPONSABLE est&aacute; cumpliendo con todas las disposiciones de las normativas GDPR y LOPD GDD para el tratamiento de los datos personales de su responsabilidad, y manifiestamente con los principios descritos en el art&iacute;culo 5 del GDPR, por los cuales son tratados de manera l&iacute;cita, leal y transparente en relaci&oacute;n con el interesado y adecuados, pertinentes y limitados a lo necesario en relaci&oacute;n con los fines para los que son tratados.&nbsp;</p>\r\n<p dir=\"ltr\">El RESPONSABLE garantiza que ha implementado pol&iacute;ticas t&eacute;cnicas y organizativas apropiadas para aplicar las medidas de seguridad que establecen el GDPR y la LOPD GDD con el fin de proteger los derechos y libertades de los USUARIOS y les ha comunicado la informaci&oacute;n adecuada para que puedan ejercerlos.&nbsp;</p>\r\n<p dir=\"ltr\">Para m&aacute;s informaci&oacute;n sobre las garant&iacute;as de privacidad, puedes dirigirte al RESPONSABLE a trav&eacute;s de iON3D Iberia S.L</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>', 'POLÍTICA DE PRIVACIDAD', 'POLÍTICA DE PRIVACIDAD', 'POLÍTICA DE PRIVACIDAD', 'es', 11),
(12, 'About us', 'about-us', '<p class=\"text-3xl mb-5 text-center\"><strong>About us</strong></p>\r\n<p style=\"text-align: justify;\">Welcome to Ion3D, your premier destination for high-quality 3D-printed covers. We specialize in crafting custom covers that not only protect your devices but also elevate their aesthetic appeal.</p>\r\n<p style=\"text-align: justify;\">At Ion3D, we recognize that your devices are more than just tools; they\'re a reflection of your personality and style. That\'s why we offer a wide array of customization options, allowing you to tailor your covers to suit your individual taste.</p>\r\n<p style=\"text-align: justify;\">Our team of expert designers and technicians leverages cutting-edge 3D printing technology to ensure that every cover we produce meets the highest standards of quality and durability. Whether you prefer a sleek and modern design or something more bold and expressive, we have the expertise to bring your vision to life.</p>\r\n<p style=\"text-align: justify;\">Customer satisfaction is at the core of everything we do. From assisting you in selecting the perfect design to ensuring prompt delivery of your cover, we are committed to providing you with an exceptional experience from start to finish.</p>\r\n<p style=\"text-align: justify;\">Join the Ion3D family today and discover how our 3D-printed covers can enhance your devices in style and functionality!</p>', 'about us', '', 'aboutus', 'en', 1),
(13, 'Eco-compromiso', 'compromiso-medioambiental', '<h1 style=\"text-align: center; font-size: 2.5em;\"><span style=\"color: rgb(32, 75, 73, 1);\"><strong>Innovaci&oacute;n y Sostenibilidad</strong></span></h1>\r\n<h1 style=\"text-align: center; font-size: 2.5em;\"><span style=\"color: rgb(32, 75, 73, 1);\"><strong>&nbsp;en la Fabricaci&oacute;n de Fundas</strong></span></h1>\r\n<p>&nbsp;</p>\r\n<hr>\r\n<h2 style=\"text-align: center; font-size: 2em;\">&nbsp;</h2>\r\n<p>&nbsp;</p>\r\n<h2 style=\"text-align: center; font-size: 2em;\"><strong>La Revoluci&oacute;n de la <span style=\"color: rgb(53, 152, 219);\">Impresi&oacute;n 3D</span></strong></h2>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">En la vanguardia de la&nbsp;<strong>innovaci&oacute;n y la sostenibilidad</strong>, la fabricaci&oacute;n en 3D por demanda est&aacute; revolucionando la industria de la producci&oacute;n de fundas. A diferencia de la fabricaci&oacute;n tradicional por inyecci&oacute;n de pl&aacute;stico, que requiere la creaci&oacute;n de grandes inventarios y conlleva riesgos como el exceso de producci&oacute;n y altos costos de almacenamiento, la impresi&oacute;n 3D ofrece una soluci&oacute;n m&aacute;s &aacute;gil y personalizada.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<h2 style=\"text-align: center; font-size: 2em;\"><strong>Beneficios de la <span style=\"color: rgb(248, 202, 198);\">P</span><span style=\"color: rgb(224, 62, 45);\">e</span><span style=\"color: rgb(185, 106, 217);\">r</span><span style=\"color: rgb(132, 63, 161);\">s</span><span style=\"color: rgb(53, 152, 219);\">o</span><span style=\"color: rgb(35, 111, 161);\">n<span style=\"color: rgb(45, 194, 107);\">a</span></span><span style=\"color: rgb(22, 145, 121);\">l</span><span style=\"color: rgb(236, 202, 250);\">i</span><span style=\"color: rgb(132, 63, 161);\">z</span><span style=\"color: rgb(194, 224, 244);\">a</span><span style=\"color: rgb(35, 111, 161);\">c</span><span style=\"color: rgb(191, 237, 210);\">i</span><span style=\"color: rgb(251, 238, 184);\">&oacute;</span><span style=\"color: rgb(230, 126, 35);\">n</span></strong></h2>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">Cada funda se fabrica individualmente seg&uacute;n el pedido espec&iacute;fico del cliente. Esto elimina la necesidad de almacenar productos y reduce significativamente el desperdicio de material. La flexibilidad de dise&ntilde;o que ofrece la <strong>impresi&oacute;n 3D</strong> permite a las empresas adaptarse r&aacute;pidamente a las tendencias del mercado sin incurrir en los costos asociados con la fabricaci&oacute;n de moldes.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<h2 style=\"text-align: center; font-size: 2em;\"><strong>Eficiencia y <span style=\"color: rgb(22, 145, 121);\">Responsabilidad</span> <span style=\"color: rgb(22, 145, 121);\">Ambiental</span></strong></h2>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">Esta eficiencia de costos se extiende a la eliminaci&oacute;n de los gastos de almacenamiento, reduciendo as&iacute; el riesgo financiero de la sobreproducci&oacute;n. Al producir solo lo necesario, las startups como la nuestra no solo reducen su huella de carbono sino que tambi&eacute;n contribuyen activamente a la lucha contra la contaminaci&oacute;n por pl&aacute;sticos, un problema ambiental cr&iacute;tico.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<h2 style=\"text-align: center; font-size: 2em;\"><strong><span style=\"color: rgb(53, 152, 219);\">Un Futuro</span> <span style=\"color: rgb(45, 194, 107);\">M&aacute;s Verde</span></strong></h2>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">Elegir la fabricaci&oacute;n en 3D por demanda no es solo una decisi&oacute;n inteligente desde el punto de vista empresarial, sino que tambi&eacute;n refleja un compromiso con la creaci&oacute;n de un futuro m&aacute;s verde. Ofreciendo productos &uacute;nicos y personalizados, las empresas pueden alinearse con los valores de sostenibilidad y responsabilidad ambiental, asegurando que sus operaciones apoyen un modelo de negocio &eacute;tico y consciente del impacto</p>', 'Compromiso medioambiental', 'Compromiso medioambiental', 'Compromiso medioambiental', 'es', 12),
(14, 'about us', 'sobre-nosotros', '<p>En la vanguardia de la innovaci&oacute;n y la sostenibilidad, la fabricaci&oacute;n en 3D por demanda est&aacute; revolucionando la industria de la producci&oacute;n de fundas. A diferencia de la fabricaci&oacute;n tradicional por inyecci&oacute;n de pl&aacute;stico, que requiere la creaci&oacute;n de grandes inventarios y conlleva riesgos como el exceso de producci&oacute;n y altos costos de almacenamiento, la impresi&oacute;n 3D ofrece una soluci&oacute;n m&aacute;s &aacute;gil y personalizada. Cada funda se fabrica individualmente seg&uacute;n el pedido espec&iacute;fico del cliente, lo que elimina la necesidad de almacenar productos y reduce significativamente el desperdicio de material.<br>La flexibilidad de dise&ntilde;o que ofrece la impresi&oacute;n 3D permite a las empresas adaptarse r&aacute;pidamente a las tendencias del mercado sin incurrir en los costos asociados con la fabricaci&oacute;n de moldes. Esta eficiencia de costos se extiende a la eliminaci&oacute;n de los gastos de almacenamiento, reduciendo as&iacute; el riesgo financiero de la sobreproducci&oacute;n. Adem&aacute;s, al producir solo lo necesario, las startups como la nuestra no solo reducen su huella de carbono sino que tambi&eacute;n contribuyen activamente a la lucha contra la contaminaci&oacute;n por pl&aacute;sticos, un problema ambiental cr&iacute;tico.<br>Elegir la fabricaci&oacute;n en 3D por demanda no es solo una decisi&oacute;n inteligente desde el punto de vista empresarial, sino que tambi&eacute;n refleja un compromiso con la creaci&oacute;n de un futuro m&aacute;s verde. Ofreciendo productos &uacute;nicos y personalizados, las empresas pueden alinearse con los valores de sostenibilidad y responsabilidad ambiental, asegurando que sus operaciones apoyen un modelo de negocio &eacute;tico y consciente del impacto ecol&oacute;gico</p>', 'Sobre nosotros', 'Sobre iON3D', 'acerca de sobre nosotros', 'en', 12),
