(22, 16, 'es', '{\"html\":\"<section class=\\\"mt-8 space-y-6 bg-gray-700 py-8 mx-auto md:py-12 lg:py-24\\\">\\r\\n    <div class=\\\"mx-auto flex max-w-[58rem] flex-col items-center space-y-4 text-center mb-14\\\">\\r\\n        <img class=\\\"lazy\\\" data-src=\\\"https:\\/\\/ion-3d.com\\/storage\\/theme\\/16\\/R6xALbQ23eMsWzgu1gROxgma4iNukAZvG8jmck81.webp\\\"alt=\\\"Logo iON3D\\\" width=\\\"340\\\" height=\\\"116\\\">\\r\\n        <br>\\r\\n        <br>\\r\\n        <p class=\\\"text-white px-6 md:px-0\\\">Descubre ION3D: fundas impresas en 3D que marcan la diferencia. Innovadoras, personalizables y eco-responsables, para un estilo \\u00fanico y sostenible.<\\/p>\\r\\n    <\\/div>\\r\\n    <div class=\\\"mx-auto grid justify-center gap-4 sm:grid-cols-2 container px-6 md:grid-cols-3\\\">\\r\\n        <div class=\\\"class=relative overflow-hidden rounded-lg border-4 border-white bg-background p-2\\\">\\r\\n            <div class=\\\"flex flex-col justify-between rounded-md p-6 \\\">\\r\\n                <polyline points=\\\"4 17 10 11 4 5 \\\"><\\/polyline>\\r\\n                <line x1=\\\"12 \\\" y1=\\\"19 \\\" x2=\\\"20 \\\" y2=\\\"19 \\\"><\\/line>\\r\\n                <div class=\\\"space-y-2 \\\">\\r\\n                     <h3 class=\\\"font-bold text-4xl mb-3 text-center\\\" style=\\\"color: #FFFFFF;\\\">Eco-Innovacion<\\/h3>\\r\\n\\r\\n                    <p class=\\\"text-white text-center \\\">Descubre la calidad y la innovaci\\u00f3n de ION3D, l\\u00edder en fundas impresas en 3D personalizables y eco-responsables. Confeccionadas en Espa\\u00f1a, nuestras fundas combinan materiales seleccionados con respeto por el medio ambiente y un compromiso con la sostenibilidad en cada detalle. \\u00a1Explora c\\u00f3mo la responsabilidad se une a la innovaci\\u00f3n en nuestra colecci\\u00f3n!<\\/p>\\r\\n                <\\/div>\\r\\n            <\\/div>\\r\\n        <\\/div>\\r\\n        <div class=\\\"class=relative overflow-hidden rounded-lg border-4 border-white